// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awListRenderFunction } from 'js/AwListService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwListService', () => import('js/AwListService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awListRenderFunction",
            "deps": "js/AwListService"
        },
        "contextPopup": {
            "actionType": "popup",
            "options": {
                "width": "200px",
                "clickOutsideToClose": true,
                "whenParentScrolls": "close"
            }
        },
        "onMount": {
            "actionType": "JSFunction",
            "method": "onMount",
            "inputData": {
                "data": "{{props}}"
            },
            "deps": "js/AwListService"
        },
        "selectionUpdated": {
            "actionType": "JSFunction",
            "method": "selectionUpdated",
            "inputData": {
                "props": "{{props}}"
            },
            "deps": "js/AwListService"
        }
    },
    "data": {
        "_init": false
    },
    "conditions": {},
    "onEvent": [],
    "ctx": {
        "mselected": null,
        "pselected": null
    },
    "lifecycleHooks": {
        "render": "render",
        "onMount": "onMount",
        "onUpdate": [
            {
                "action": "selectionUpdated",
                "observers": [
                    "props.dataprovider.selectedObjects"
                ]
            }
        ]
    },
    "props": {
        "dataprovider": {
            "type": "object"
        },
        "show-check-box": {
            "type": "string"
        },
        "item-options": {
            "type": "object"
        },
        "show-context-menu": {
            "type": "string"
        },
        "fixed-cell-height": {
            "type": "string"
        },
        "use-virtual": {
            "type": "boolean"
        },
        "show-drop-area": {
            "type": "boolean"
        },
        "is-group-list": {
            "type": "boolean"
        },
        "has-floating-cell-commands": {
            "type": "boolean"
        },
        "show-decorators": {
            "type": "boolean"
        },
        "command-context": {
            "type": "object"
        },
        "double-click-action": {
            "type": "action"
        }
    },
    "_viewModelId": "AwList",
    "_uniqueViewModelId": "AwList"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awListRenderFunction, undefined, ctxImportObj );

export default Component;
